 ('49', '113', '9', '1', 'en_us', '1', '', '{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"About Me\",\"slug\":\"about-me\",\"postDate\":1517969305,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"50\":{\"new1\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"heading\":\"\",\"headingColor\":\"#000000\",\"image\":[\"112\"],\"linkAddress\":\"\"}}},\"46\":{\"new1\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"heading\":\"\",\"headingColor\":\"#000000\",\"image\":[\"111\"],\"linkAddress\":\"\"}}},\"54\":{\"new1\":{\"type\":\"about\",\"enabled\":\"1\",\"fields\":{\"heading\":\"Crystal Perry\",\"body\":\"<p>Crystal Z. Perry is a Forbes featured Dallas, TX native and resident. Shortly after college graduation, she pursued a career in corporate America. While working as a recruiter, she began decorating residential and commercial spaces.&nbsp; After years of offering contract negotiation tips to Dallas\\u2019 Grammy award winning musicians, Crystal began to seriously consider management.&nbsp;<\\/p>\\r\\n<p>Present day, she is the co-founder of Forbes.com featured DFWCrewLove. DFWCrewLove is a movement dedicated to creating awareness about the global influence of Dallas\\/Ft. Worth artists. Today, Crystal splits her time between DFWCrewLove and MelaninpHactor. Melaninphactor is her lifestyle brand dedicated to the empowerment of black women and children. She is regularly involved in branding strategies for artists and businesses. She will host a panel at the 2017 SXSW Festival. Crystal received her undergraduate degree from Texas A&M University in College Station, TX. Her Internet Marketing, Master of Science is from Full Sail University in Winter Park, FL. Crystal is Google Certified<\\/p>\",\"linkText\":\"read press releases\",\"linkAddress\":\"\\/press\"}}}}}', '2018-02-07 02:08:26', '2018-02-07 02:08:26', 'bfaab62b-4c23-4d71-ad1e-1dd681858f33'),
