 ('1', '72', 'en_us', 'read the forbes interview', '', 'www.google.com', '#451f34', NULL, NULL, NULL, NULL, NULL, '2018-01-27 20:31:51', '2018-02-07 04:02:55', '3ce5d1f5-60e2-470d-a316-079f340dd1a8'),
 ('2', '73', 'en_us', 'test 2', '', 'www.google.com', '#451f34', NULL, NULL, NULL, NULL, NULL, '2018-01-27 20:31:51', '2018-02-07 04:02:55', 'b8edd81f-5efa-4c4d-bec5-89b38f34ef0f'),
 ('3', '103', 'en_us', 'Shop Future Rich', '', '', '#451f34', NULL, NULL, NULL, NULL, NULL, '2018-02-04 05:04:13', '2018-02-05 03:11:59', '43baa59a-16ea-4682-924c-2879d688ebe5'),
 ('4', '104', 'en_us', 'Shop Melanin', '', '/shop/melanin', '#451f34', NULL, NULL, NULL, NULL, NULL, '2018-02-04 05:04:13', '2018-02-05 03:11:59', '04abd604-e0cb-491e-8daa-b403158b5842'),
 ('5', '110', 'en_us', NULL, NULL, NULL, NULL, 'Contact Us', NULL, NULL, NULL, NULL, '2018-02-06 04:51:23', '2018-02-06 04:58:58', '7a18460b-8e3e-4326-923e-a0697c47f384'),
 ('6', '116', 'en_us', NULL, NULL, NULL, NULL, NULL, 'Crystal Perry', '<p>Crystal Z. Perry is a Forbes featured Dallas, TX native and resident. Shortly after college graduation, she pursued a career in corporate America. While working as a recruiter, she began decorating residential and commercial spaces.  After years of offering contract negotiation tips to Dallas’ Grammy award winning musicians, Crystal began to seriously consider management. </p>\n<p>Present day, she is the co-founder of Forbes.com featured DFWCrewLove. DFWCrewLove is a movement dedicated to creating awareness about the global influence of Dallas/Ft. Worth artists. Today, Crystal splits her time between DFWCrewLove and MelaninpHactor. Melaninphactor is her lifestyle brand dedicated to the empowerment of black women and children. She is regularly involved in branding strategies for artists and businesses. She will host a panel at the 2017 SXSW Festival. Crystal received her undergraduate degree from Texas A&amp;M University in College Station, TX. Her Internet Marketing, Master of Science is from Full Sail University in Winter Park, FL. Crystal is Google Certified</p>', 'read press releases', '/press', '2018-02-07 02:08:25', '2018-02-07 02:08:25', '08f3db2a-b660-4bfc-a481-481770346794');



